// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21;
pragma experimental ABIEncoderV2;
import './Operations.sol';

contract SellingDismantlingBuying is Operations{

    //---Selling---
    struct OldProductStruct {
      string productname;
      string productID;
      string Ptype;
      string details;
      string sellingPrice;
      string productImg;
      string collectionCenter;
      uint256 uploaddate;
    }

    mapping (string => string[]) public userProductMap;
    mapping (string => OldProductStruct) public ProductDetailsMap;

    function addProduct(string memory name, string memory ProdType, string memory details, 
                            string memory price, string memory productImg, string memory userID, uint256 date) public 
    {
        //Convert int to string 
        string memory H="-P";
        string memory PID=concatenate(H,IntToString(userProductMap[userID].length));
        string memory ProdID=concatenate(userID,PID);

        string memory CC = "NA";

        userProductMap[userID].push(ProdID);
        ProductDetailsMap[ProdID]=OldProductStruct(name,ProdID,ProdType,details,price,productImg,CC,date);
    }

    function setCompanyCentertoProduct(string memory CompanyID,string memory ProdID) public
    {
        ProductDetailsMap[ProdID].collectionCenter=CompanyID;
    }

    function getProductDetails(string memory ProductID) public view returns (OldProductStruct memory _OldProductStruct) {
        return ProductDetailsMap[ProductID];
    }

    //---Dismantling---
    struct CompanyScraps {
      string ScrapName;
      string ScrapType;
      string ScrapImage;
      string Details;
      string QtyType;
      uint currentQty;
      string costper;
      string CompanyID;
    }

    mapping (string => string[]) public companyScrapsMap;
    mapping (string => CompanyScraps) public companyScrapsDetailsMap;

    function newCompanyScrap(string memory CompanyID, string memory ScrapName, string memory ScrapType, string memory ScrapImage,
                                        string memory Details, string memory QtyType, string memory sellingcost) public
    {
        string memory H="-S";
        string memory SID=concatenate(H,IntToString(companyScrapsMap[CompanyID].length));
        string memory ScrapID=concatenate(CompanyID,SID);

        companyScrapsMap[CompanyID].push(ScrapID);
        companyScrapsDetailsMap[ScrapID]=CompanyScraps(ScrapName,ScrapType,ScrapImage,Details,QtyType,0,sellingcost,CompanyID);
    }

    function updateScrapQty(string memory SID, uint qty) public
    {
        companyScrapsDetailsMap[SID].currentQty+=qty;
    }

    struct ProductScraps
    {
        string ScrapID;
        uint qtyObtained;
    }

    mapping (string => ProductScraps[]) public productScrapsMap;

    function newCompanyScrap(string memory ProductID, string memory ScrapID, uint qty) public
    {
        productScrapsMap[ProductID].push(ProductScraps(ScrapID,qty));
        updateScrapQty(ScrapID,qty);
    }

    //---Buying---
    struct BuyBill
    {
        string BillID;
        string CompanyID;
        string CenterID;
        string ScrapID;
        uint qty;
        string final_cost;
    }

    mapping (string => BuyBill[]) public BillDetailsMap;

    function newBusinessBill(string memory BillID, string memory CompanyID, string memory CenterID, 
                                string memory ScrapID, uint qty, string memory final_cost) public
    {
        BillDetailsMap[CompanyID].push(BuyBill(BillID,CompanyID,CompanyID,ScrapID,qty,final_cost));
        updateScrapQty(ScrapID,-qty);
    }

}
